import React from "react";
import SearchBar from "../SearchBar";
import style from "../Nav/Nav.module.css";

const Nav = () => {
  return (
    <> className={style.container}>
        <SearchBar onSearch={(characterID) => window.alert(characterID)} />
    </>
  );
};

export default Nav;
